import React from 'react'

import { SettingsIcon } from './icons'

export default class extends React.Component {
  render() {
    return (
      <div class="bg-red-400 fixed inset-x-0 top-0 flex items-center px-2 md:py-2 space-x-2 lg:space-x-4 justify-end">
        <h1 class="text-xl text-white">蒸気<span class="text-gray-300">の</span>博物館</h1>
        <input class="appearance-none bg-transparent border-2 rounded-sm text-white px-2 py-1 w-96 min-w-0" style={{borderColor: 'rgba(255, 255, 255, 0.5)'}}></input>
        <div class="cursor-pointer p-1" onClick={this.props.skipBack}>
          <SettingsIcon class="h-6 lg:h-8" color="#fff"/>
        </div>
        <div class="cursor-pointer p-1">
          <SettingsIcon class="h-6 lg:h-8" color="white" />
        </div>
      </div>
    )
  }
}

